DROP SCHEMA IF EXISTS gym;

CREATE SCHEMA gym;
USE gym;

/* * * * * * * * * * * * * * * * *  CREATE TABLE STRUCTURE  * ** * * *  * **  * * * * * * * * */

CREATE TABLE IF NOT EXISTS classType
(
ClassType VARCHAR(20) PRIMARY KEY NOT NULL,
Room VARCHAR(20) NOT NULL,
Capacity INT NOT NULL,
HourlyRate FLOAT NOT NULL
);

CREATE TABLE IF NOT EXISTS staff
(
StaffID INT PRIMARY KEY NOT NULL AUTO_INCREMENT, 
FirstName VARCHAR(25) NOT NULL,
LastName VARCHAR(25) NOT NULL,
EmailAddress VARCHAR(100) NOT NULL,
PhoneNumber VARCHAR(20) NOT NULL,
DateOfBirth DATE NOT NULL,
StaffType VARCHAR(25) NOT NULL,
AboutMe VARCHAR(1000),
PhotoLink VARCHAR(500) 
);

CREATE TABLE IF NOT EXISTS timeSlots
(
TimeSlotsID INT PRIMARY KEY NOT NULL AUTO_INCREMENT,
StartTime TIME NOT NULL,
FinishTime TIME NOT NULL
);


CREATE TABLE IF NOT EXISTS timetable
(
ClassID INT PRIMARY KEY NOT NULL AUTO_INCREMENT,
ClassType VARCHAR(20) NOT NULL,
TrainerID INT NOT NULL,
WeekNum INT NOT NULL,
ClassDate DATE NOT NULL,
TimeSlotsID INT NOT NULL,
Duration INT NOT NULL DEFAULT 1,
FOREIGN KEY (ClassType) REFERENCES classType(ClassType)
	ON UPDATE CASCADE
	ON DELETE CASCADE,
FOREIGN KEY (TimeSlotsID) REFERENCES timeSlots (TimeSlotsID)
	ON UPDATE CASCADE
	ON DELETE CASCADE,
FOREIGN KEY (TrainerID) REFERENCES staff(StaffID)
	ON UPDATE CASCADE
	ON DELETE CASCADE
);

CREATE TABLE IF NOT EXISTS news
(
NewsID INT PRIMARY KEY NOT NULL AUTO_INCREMENT, 
StaffID INT NOT NULL,
Subject VARCHAR(50) NOT NULL,
Content VARCHAR(3000) NOT NULL,
Date DATE NOT NULL,
FOREIGN KEY (StaffID) REFERENCES staff(StaffID)
	ON UPDATE CASCADE
	ON DELETE CASCADE
);

CREATE TABLE IF NOT EXISTS paymentFrequency
(
PaymentFrequency VARCHAR(25) PRIMARY KEY NOT NULL,
Rate FLOAT NOT NULL
);


CREATE TABLE IF NOT EXISTS member 
(
MemberID INT PRIMARY KEY NOT NULL AUTO_INCREMENT,
FirstName VARCHAR(25) NOT NULL,
LastName VARCHAR(25) NOT NULL,
DateOfBirth DATE NOT NULL,
PaymentFrequency VARCHAR(25) NOT NULL DEFAULT 'Monthly',
EmailAddress VARCHAR(50) NOT NULL,
PhoneNumber VARCHAR(20) NOT NULL,
Address VARCHAR(80) NOT NULL DEFAULT '123 tbc Road',
MedicalConditions VARCHAR(100) NOT NULL DEFAULT 'None',
IsActive BOOLEAN NOT NULL DEFAULT 1,
Checkin BOOLEAN NOT NULL DEFAULT 0,
FOREIGN KEY (PaymentFrequency) REFERENCES paymentFrequency (PaymentFrequency)
	ON UPDATE CASCADE
	ON DELETE CASCADE
);



CREATE TABLE IF NOT EXISTS booking 
(
ClassID INT NOT NULL,
MemberID INT NOT NULL,
PaymentAmount FLOAT NOT NULL,
PaymentDate DATE,
IsPaid BOOLEAN NOT NULL,
HasAttended BOOLEAN NOT NULL,
CONSTRAINT PK_booking PRIMARY KEY(ClassID,MemberID),
FOREIGN KEY (MemberID) REFERENCES member(MemberID)
	ON UPDATE CASCADE
	ON DELETE CASCADE,
FOREIGN KEY (ClassID) REFERENCES timetable(ClassID)
	ON UPDATE CASCADE
	ON DELETE CASCADE
);



CREATE TABLE IF NOT EXISTS subscription
(
SubscriptionID INT PRIMARY KEY NOT NULL AUTO_INCREMENT,
MemberID INT NOT NULL,
StartDate DATE NOT NULL,
ExpiryDate DATE NOT NULL,
PaymentAmount FLOAT NOT NULL,
PaymentDate DATE,
FOREIGN KEY (MemberID) REFERENCES member(MemberID)
	ON UPDATE CASCADE
	ON DELETE CASCADE
);

CREATE TABLE IF NOT EXISTS attendance
(
AttendanceID INT PRIMARY KEY NOT NULL AUTO_INCREMENT,
MemberID INT NOT NULL,
TypeOfVisit VARCHAR(25) NOT NULL,
Date DATE NOT NULL,
CheckinTime TIME,
CheckoutTime TIME,
FOREIGN KEY (MemberID) REFERENCES member(MemberID)
	ON UPDATE CASCADE
	ON DELETE CASCADE
);


 
/* * * * * * * ** * * * * * * * *  * *  POPULATE TABLES * * * * * * * * * * * * * * * * * * * * */
 
